import React, { Fragment, useMemo } from 'react';

// Components
import HeaderColor from '../header-color';

// Utils
import { COLORS } from '../../utils/colors';

// Styles
import './PageLayout.css';
import useMostClickedColor from '../../hooks/useMostClickedColor';

function PageLayout() {
    const { mostClicked } = useMostClickedColor();

    const mostClickedColor = useMemo(() => (
        `Most clicked color ${mostClicked}`
    ), [mostClicked]);

    return (
        <div className={'page-layout'}>
            <section className={'page-layout-colors'}>
                <h3>Colors</h3>
                    { Object.keys(COLORS).map((color, index) =>
                        <Fragment key={index}>
                            <HeaderColor color={color} />
                        </Fragment>
                    )}
                {!!mostClickedColor && <p className={'page-layout-counter'}>{mostClickedColor}</p>}
            </section>
        </div>
    );
}

export default PageLayout;
